import { useRef } from 'react';
import { NavLink } from 'react-router-dom';
import Scroll, {Link} from 'react-scroll';
const ScrollLink = Scroll.ScrollLink

export default function NavBar() {
    const finishedProjects = useRef(null)
    const fpScroll = () => {
        finishedProjects.current?.scrollIntoView({ behavior: 'smooth' });
    };
    return (
        <>
            <div href="/" className="d-flex align-items-center pb-3 mb-3 link-dark text-decoration-none border-bottom ">
                <NavLink className="link-dark text-decoration-none" to="/">
                    <div>
                        <img className="pt-2 ms-1" src="./bun.png" width="" height="80" alt="no bun :(" />
                    </div>
                </NavLink>
                <span className="ms-3 mb-2 fs-2 fw-semibold nameText">Adrian Dorado</span>
                <span className="ms-1 fs-1 fw-semibold nameText csep">||</span>
                <span className="ms-1 mt-2 fs-4 fw-semibold nameText">Full-Stack Software Engineer</span>
                <Link to='finished-projects' spy={true} smooth={true} duration={100} className='ms-auto link-dark'>
                    <button className="ms-auto btn btn-toggle rounded border-0 collapsed fs-2 fw-semibold nameText">
                        Home
                    </button>
                </Link>
                <div className="dropdown">
                    <button className="btn btn-toggle rounded border-0 dropdown-toggle fs-2 fw-semibold nameText" type="button" id="dropdownMenuButton2" data-bs-toggle="dropdown" aria-expanded="false">
                        Projects
                    </button>
                    <div className="dropdown-menu dropdown-menu-light" aria-labelledby="dropdownMenuButton2">
                        <li><button onClick={fpScroll} className="fs-4 dropdown-item nameText" aria-current="page">Finished Projects</button></li>
                        <li><button className="fs-4 dropdown-item nameText" aria-current="page" to="ongoing-projects/">Ongoing Projects</button></li>
                    </div>
                </div>
                <NavLink className="link-dark text-decoration-none" to="links/">
                    <button className="btn btn-toggle rounded border-0 collapsed fs-2 fw-semibold nameText">
                        Links
                    </button>
                </NavLink>
            </div>
        </>
    )
};
